import React, { Component } from "react";
import Input from "./input.jsx";

class aliasedInput extends Component {
  state = {};
  render() {
    const {
      titleLabel,
      id,
      name,
      title,
      aliases,
      // handleTitleChange,
      // handleAliasChange
      handleChange
    } = this.props;
    return (
      // <div className="col-4">
      <div>
        <Input
          label={titleLabel}
          id={id}
          name={name}
          value={title}
          onChange={(e) => handleChange(e)}
          // onChange={handleChange}
          margin=""
          size={"form-control-lg"}
        />
        <Input
          label="Aliases"
          id="1key"
          name="skill"
          value={aliases}
          onChange={(e, id) => handleChange(id, e)}
          onChange={handleChange}
          // margin="ml-5"
          size={"form-control-sm"}
        />
      </div>
    );
  }
}

export default aliasedInput;
